import React, { useEffect } from 'react';
import './collection.styles.scss';
import { connect } from 'react-redux';
import { selectBrandCollection } from '../../redux/selectors/shop.selector';
import { fetchCollectionsStart } from '../../redux/actions/shop';

const BrandCollection = ({ match, brandCollection, fetchCollectionsStart }) => {
  //   console.log(match);
  console.log(brandCollection);

  useEffect(() => {
    fetchCollectionsStart();
  });

  return <div className='collection-page'>YES BRAND PAGE</div>;
};

